import streamlit as st
from streamlit_option_menu import option_menu

with st.sidebar:
    menu=option_menu(
        menu_title="vinsup",
        options=["home","about","contact"],
    )
if menu == "home":
    st.title("welcome to vinsup")
    col1,col2=st.columns(2)
    with col1:
        st. image("data:image/jpeg;base64,")
        st.write("beautiful")
    with col2:
        st.write("this is the code")
elif menu == "about":
    st.title("about vinsup")
elif menu == "contact":
    st.title("contact")
